// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract AssetTracker {
    struct Asset {
        string name;
        string description;
        uint cost;
        uint quantity;
        string manufacturer;
        string customer;
        string addressFrom;
        string addressTo;
        bool initialized;
        bool arrived;
        uint distributorld;
        // uint uniqueProductId;
        // bool isAuthentic;  
    }

    struct Person {
        uint id;
        string name;
        string add;
        string email;
        string phone;
    }

    mapping(uint => Person) private distributorStruct;
    uint public distributorCount = 0;
    uint public assetCount = 0;
    
    event RejectDistributor(string name, string add, string email, string phone);

    function insertDistributor(
        string memory name, 
        string memory add, 
        string memory email, 
        string memory phone
    ) public returns(bool) {
        for(uint i = 0; i < distributorCount; i++) {
            require(
                keccak256(abi.encodePacked((distributorStruct[i].email))) != 
                keccak256(abi.encodePacked(("123@gmail.com"))),
                "Distributor already exists"
            );
        }
        
        distributorStruct[distributorCount] = Person(distributorCount, name, add, email, phone);
        distributorCount++;
        return true;
    }

    function getDistributorbyId(uint id) public view returns(
        string memory, 
        string memory, 
        string memory, 
        string memory
    ) {
        return (
            distributorStruct[id].name, 
            distributorStruct[id].add, 
            distributorStruct[id].email, 
            distributorStruct[id].phone
        );
    }

    function getAllDistributors() public view returns (Person[] memory) {
        Person[] memory id = new Person[](distributorCount);
        for (uint i = 0; i < distributorCount; i++) {
            Person storage member = distributorStruct[i];
            id[i] = member;
        }
        return id;
    }

    function balance(uint _amount) public pure returns(bool) {
        require(_amount > 20, "Balance need to be greater than 20");
        return true;
    }

    mapping(uint => Asset) private assetStore;
    mapping(address => mapping(uint => bool)) private walletStore;

    function createAsset(
        string memory name, 
        string memory description,
        uint distributorld,
        uint cost, 
        uint quantity, 
        string memory manufacturer, 
        string memory customer,
        string memory addressFrom, 
        string memory addressTo
    ) public {
        assetStore[assetCount] = Asset(
            name,
            description,
            cost,
            quantity,
            manufacturer,
            customer,
            addressFrom,
            addressTo,
            true,
            false,
            distributorld
        );
            // assetCount,  // uniqueProductId
            // true // isAuthentic
        walletStore[msg.sender][assetCount] = true;
        assetCount++;
    }

    function transferAsset(address to, uint i) public {
        // require(i < assetCount, "No asset with this UUID exists");
        require(assetStore[assetCount].initialized == true, 
        "No asset with this UUID exists");
        require(walletStore[msg.sender][i], "Sender does not own this asset");
        
        walletStore[msg.sender][i] = false;
        walletStore[to][i] = true;
    }

    function getItemByUUID(uint i) public view returns(uint cost, uint quantity) {
        require(i <= assetCount, "Asset does not exist");
        return (assetStore[i].cost, assetStore[i].quantity);
    }

    function isOwnerOf(address owner, uint i) public view returns (bool) {
        if(walletStore[owner][i]) {
            return true;
        }
        return false;
    }

    function getAllAssets() public view returns (Asset[] memory) {
        Asset[] memory x = new Asset[](assetCount);
        for (uint i = 0; i < assetCount; i++) {
            Asset storage member = assetStore[i];
            x[i] = member;
        }
        return x;
    }

    function markAsArrived(uint i) public {
        assetStore[i].arrived = true;
    }
}
